import React, { useState, useEffect } from 'react';
import ConsultationForm from './components/consultationform';
import ConsultationList from './components/ConsultationList';
import { getConsultations, createConsultation } from './services/api';

function App() {
  const [consultations, setConsultations] = useState([]);

  useEffect(() => {
    fetchConsultations();
  }, []);

  const fetchConsultations = async () => {
    const response = await getConsultations();
    setConsultations(response.data);
  };

  const handleAddConsultation = async (consultation) => {
    const response = await createConsultation(consultation);
    setConsultations([...consultations, response.data]);
  };

  return (
    <div className="App">
      <h1>Student Consultation App</h1>
      <ConsultationForm onAddConsultation={handleAddConsultation} />
      <ConsultationList consultations={consultations} />
    </div>
  );
}

export default App;
